def formatNumber(num):
    if len(str(num)) < 7:
        return format_number(num)
    millnames = ['', 'T', 'M', 'B', 'T']
    num = float(num)
    millidx = max(0, min(len(millnames)-1, int(math.floor(0 if num == 0 else math.log10(abs(num))/3))))
    return '{:.0f} {}'.format(num/10**(3*millidx), millnames[millidx])
    
