            h.append(moneys[i][0])
            no+=1
            a = '{}'.format(humanize.naturaltime(datetime.fromtimestamp(i/1000)))
            if no == len(sort):msgas+='\nâ”‚{}. @!\nâ•°    ã€Œ {} ã€'.format(no,a)
            else:msgas+='\nâ”‚{}. @!\nâ”‚    ã€Œ {} ã€'.format(no,a)
